import React from "react";
import {Container, Card, Card3} from '../Styles/Style';

// O gráfico de incidentes deve exibir um gráfico de pizza com o nome das categorias, a cor de cada categoria e a porcentagem em relação ao total de incidentes.

const GraficosIncidentes = (props) => {
    return(
        <>
            {/* <p>ID: {props.dataIncidents.category}</p> */}
            {props.dataIncidents &&
              props.dataIncidents.map((p) => {
                console.log('CATEOGORIA NOME: ', p.category, 'CATEGORIA TAMANHO: ', p.category.length)
                const tamanho = p.category.length

            return (
                <Card3>
                   <p>Graficos</p>
                  <p>NOME: {p.category} TAMANHO: {tamanho}</p>
              </Card3>
            )
          })}
        </>
    )
}

export default GraficosIncidentes;
